import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import { Home } from './views/home/HomeView';

const App = () => {
  const NotFound = () => {
    return <Link to="..">돌아가!!</Link>;
  };

  return (
<BrowserRouter>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/*" element={<NotFound />} />
        </Routes>
      </BrowserRouter>
  );
}

export default App;
